import React from 'react';

const Usersloder = () => {
    return Array(6).fill({}).map(()=>{
        return(
                <div className='col-4 mb-6' > 
                        <div class="card-body">
    <h5 class="card-title placeholder-glow">
      <span class="placeholder col-6"></span>
    </h5>
    <p class="card-text placeholder-glow">
      <span class="placeholder col-7"></span>
      <span class="placeholder col-4"></span>
      <span class="placeholder col-4"></span>
      <span class="placeholder col-6"></span>
      <span class="placeholder col-8"></span>
    </p>
    <a href="#" tabindex="-1" class="btn btn-sm btn-warning disabled placeholder col-6 m-5"></a>
    <a href="#" tabindex="-1" class="btn btn-sm btn-danger disabled placeholder col-6 m-5"></a>
  </div>
                </div>    
        )
    });
}

export default Usersloder;
